"use strict";

var _dom = require("../../../dom");

if (__DEV__) {
  var webpackRendererConnect = _dom.rendererConnect;

  window.onHotReloadError = function () {
    return webpackRendererConnect.postMessage({
      type: 'rendererHmrFail',
      payload: {
        rendererId: _dom.rendererId
      }
    });
  };
}
